import { documentToReactComponents } from '@contentful/rich-text-react-renderer';

export default function Recipe({recipe}){
    const title = recipe.title
    const description = recipe.description
    const ingredients = recipe.ingredients
    const instructions = recipe.instructions

    const descriptionRT = documentToReactComponents(recipe.descriptionRt) 
    const ingredientsRT = documentToReactComponents(recipe.ingredientsRt)
    const instructionsRT = documentToReactComponents(recipe.ingredientsRt)     

    console.log('RECIPE: ', recipe);
    console.log('Titel: ', title);
    console.log('Description: ', description);
    console.log('ingredients: ', ingredients);
    console.log('instructions: ', instructions);

    console.log('DescriptionRT: ', descriptionRT);
    console.log('ingredientsRT: ', ingredientsRT);
    console.log('instructionsRT: ', instructionsRT);

    return (
        <div>
            <h1>{title}</h1>
            <h2>{descriptionRT}</h2>
            <div>
                <h3>Ingredients</h3>
                {ingredientsRT}
            </div>
            <div>
            <h3> How to</h3>
            <p>
                {instructionsRT}
            </p>
            </div>
        </div>
    )
}
